import React from 'react';
import Modal from 'react-modal';

export class DrOverlay extends React.Component
{
    render() {

        return(
            <div>
                <Modal isOpen={true}>
                    <h2>Select Your Doctor...</h2>

                </Modal>
            </div>
        );
    }
}
